// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./VotingToken.sol"; // Adjust import path if needed

contract SimpleVoting {
    struct Candidate {
        string name;
        uint voteCount;
    }

    struct Voter {
        bool hasVoted;
        string votedFor;
    }

    address public owner;
    bool public votingActive;
    uint public tokenFee;

    Candidate[] public candidates;
    mapping(address => Voter) public voters;

    VotingToken public votingToken;

    // Events
    event Voted(address indexed voter, string candidate);
    event VotingStarted();
    event VotingEnded();

    // Modifiers
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier whenVotingActive() {
        require(votingActive, "Voting is not active");
        _;
    }

    modifier whenVotingInactive() {
        require(!votingActive, "Voting is active");
        _;
    }

    /// @notice Constructor to initialize contract with token address and vote fee
    constructor(address _tokenAddress, uint _tokenFee) {
        require(_tokenAddress != address(0), "Invalid token address");
        owner = msg.sender;
        votingToken = VotingToken(_tokenAddress);
        tokenFee = _tokenFee;
    }

    function addCandidate(string memory _name) public onlyOwner whenVotingInactive {
        candidates.push(Candidate({ name: _name, voteCount: 0 }));
    }

    function startVoting() public onlyOwner whenVotingInactive {
        votingActive = true;
        emit VotingStarted();
    }

    function vote(string memory _candidateName) public whenVotingActive {
        Voter storage voter = voters[msg.sender];
        require(!voter.hasVoted, "Already voted");

        // Collect token fee
        require(
            votingToken.transferFrom(msg.sender, address(this), tokenFee),
            "Token transfer failed"
        );

        bytes32 targetHash = keccak256(abi.encodePacked(_candidateName));
        bool found = false;

        for (uint i = 0; i < candidates.length; i++) {
            if (keccak256(abi.encodePacked(candidates[i].name)) == targetHash) {
                candidates[i].voteCount++;
                found = true;
                break;
            }
        }

        require(found, "Candidate does not exist");

        voter.hasVoted = true;
        voter.votedFor = _candidateName;

        emit Voted(msg.sender, _candidateName);
    }

    function endVoting() public onlyOwner whenVotingActive {
        votingActive = false;
        emit VotingEnded();
    }

    function getWinner() public view returns (string memory) {
        require(!votingActive, "Voting is still active");
        require(candidates.length > 0, "No candidates");

        uint winningVoteCount = candidates[0].voteCount;
        uint winningIndex = 0;

        for (uint i = 1; i < candidates.length; i++) {
            if (candidates[i].voteCount > winningVoteCount) {
                winningVoteCount = candidates[i].voteCount;
                winningIndex = i;
            }
        }

        return candidates[winningIndex].name;
    }

    /// @notice Withdraw collected token fees to owner
    function withdrawTokens(address to) external onlyOwner {
        uint balance = votingToken.balanceOf(address(this));
        require(votingToken.transfer(to, balance), "Withdraw failed");
    }
}
